- input: "TEXT\x1CC00001305\x1C.TEXT\x1C\x1CF3XA\x1CResponse to FEC Letter of April
    15, 2013 requesting additional information for the 30 Day Post-General Report
    (10/18/2012 - 11/26/2012)                                                   Regarding
    the referenced Schedule A Line 12 transfer in from the Republican National Committee,
    funds received included a letter stating that none of the funds transferred were
    earmarked for any particular program or purpose.  The Schedule B Line 30(B) disbursements
    listed on this Letter represent volunteer activity that meets the definition of
    Exempt Party Activities set forth in 11CFR100.87 and 100.147.  Payments for these
    disbursements were made from permissable Federal funds, and did not include any
    designated candidate funds.\n"
